import React from 'react';
import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div>
	  <nav id="navbar" class="bg-dark navbar-dark  navbar navbar-expand-sm fixed-top">
    <button class="navbar-toggler pull-right" type="button" data-toggle="collapse" data-target="#collapsibleNavbar">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse justify-content-end" id="collapsibleNavbar">
     <ul class="navbar-nav">
      <li class="nav-item">
        <a class="nav-link" href="#welcome-section">About</a>
      </li> 
      <li class="nav-item">
        <a class="nav-link" href="#projects">Projects</a>
      </li>
      <li class="nav-item">
        <a class="nav-link"href="#contact">Contact</a>
      </li>
     </ul>
    </div>
  </nav>

    </div>
  );
}

export default App;
